  return (
    <div className="">
      <nav class="main-menu">
        {genersId.map(gener => (
          <li class="darkerli">
            <Link to={`/${gener.name}`}>

            </Link>

          </li>
        ))}
          <li class="darkerli">
            <a href="http://startific.com">
              <i class="fa faIcon fa-clock-o fa-lg"></i>
              <span class="nav-text">News</span>
